import React, {Component} from 'react';

import './Documentation.css';

export default class Documentation extends Component {
    constructor() {
        super();

        this.state = {
            items: []
        }
    }

    componentDidMount() {
        fetch(`https://newsapi.org/v2/everything?q=bitcoin&from=2019-12-10&sortBy=publishedAt&apiKey=f566edbf781c4d2ba135236a869fa6ae`)
            .then((response) => {
                return response.json();
            })
            .then((data) => {
                console.log(data);
            })
    }

    render() {

        const {status, code, message} = this.state;

        return (
            <div className="documentation">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            <h2>{status}</h2>
                            <p>{code}</p>
                            <button>{message}</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
};
